import ExpenseItem from './ExpenseItem';
import './Expenses.css';

function Expenses(props) {
    return ( <
        div className = "expenses" > {
            props.expenses.map(item => ( <
                ExpenseItem title = { item.title }
                amount = { item.amount }
                date = { item.date }
                curr = { item.currency } > < /ExpenseItem>
            ))
        } <
        /div>
    );
}

export default Expenses;
